import { Container,Row,Col } from "react-bootstrap";
import { Link } from "react-router-dom";
import { MailchimpForm } from "./MailchimpForm";
import logo from '../../Assets/image/logo.png';
import navIcon1 from '../../Assets/image/b.png';
import navIcon2 from '../../Assets/image/c.png';
import navIcon3 from '../../Assets/image/d.png';

export const Footer=()=>{
    return (
        <footer className="footer">
            <Container>
                <Row className="align-items-center">
                    {/* <MailchimpForm /> */}
                    <Col sm={6}>
                    <Link to={`/`}><img src={logo} alt="logo"></img></Link>
                    </Col>
                    <Col className="text-center">
                    <p>CopyRight 2022<br></br>All Rights Reserved </p>
                    </Col>
                    <Col sm={6} className="text-center text-sm-end">
                        <div className="social-icon">
                        <Link to={`/joinUs`}><img src={navIcon1} alt=""/></Link>
                        <Link to={`/signIn`}><img src={navIcon2} alt=""/></Link>
                        <Link to={`/signUp`}><img src={navIcon3} alt=""/></Link>
                        </div>
                    </Col>
                </Row>
            </Container>
        </footer>
    )
}
